create type currency as enum ('ron', 'eur', 'usd');

create type metatype as enum (
    'TEXT',
    'NUMBER',
    'SELECT',
    'BOOL',
    'DATE',
    'TIME'
);

create table templates (
    "id" serial PRIMARY KEY,
    "key" varchar(64) not null,
    "subject" text,
    "text" text,
    "html" text,
    "props" text,
    unique("key")
);

CREATE INDEX templates_index_key ON templates ("key");

create table counties (
    "id" serial not null,
    "auto" varchar(5),
    "name" varchar(50),
    constraint "counties_id"
        primary key ("id")
);

create table cities (
    "id" serial not null,
    "county" int not null,
    "name" varchar(50) not null,
    "other_name" varchar(50),
    constraint "cities_id"
        primary key ("id"),
    constraint "cities_county"
        foreign key("county") 
        references counties(id) on update cascade on delete cascade
);

create table users (
    id serial primary key,
    email varchar(255) not null,
    password varchar(255),
    given_name varchar(255) not null,
    family_name varchar(255) not null,
    phone varchar(20),
    city integer references cities(id),
    picture varchar(255),
    email_activation_token varchar(255),
    phone_activation_token varchar(255),
    created_at timestamp not null default current_timestamp,
    email_activated_at timestamp,
    phone_activated_at timestamp
);

ALTER SEQUENCE users_id_seq RESTART WITH 1000;

CREATE INDEX users_activated_index ON users (email_activated_at);

create table categories (
    "id" serial not null,
    "name" varchar(128) not null,
    "slug" varchar(255) not null,
    "description" varchar(255),
    "parent" int,
    "sort" int default 0,
    "pricing" boolean default true,
    "hidden" boolean default false,
    constraint "categories_id"
        primary key ("id"),
    constraint "categories_parent"
        foreign key("parent") 
        references categories(id) on update cascade on delete cascade,
    constraint "categories_slug_unique" unique ("slug")
);

create index categories_name_index on categories ((lower(name)));
create index categories_slug_index on categories ((lower(slug)));
create index categories_parent_index on categories (parent);
create index categories_sort_index on categories (sort);
create index categories_hidden_index on categories (hidden);

create table meta_props (
    "id" serial not null,
    "name" varchar(64) not null,
    "title" varchar(64) not null,
    "group" varchar(32) default 'default', -- group props by key in the view
    "sort" int default 0,
    "required" boolean default false,
    "template" varchar(100),
    "description" varchar(300), --shiot description of the prop
    "help" varchar(32),--help key
    "type" metatype not null,
    "options" jsonb,
    "microdata" varchar(64),
    constraint "meta_props_id" primary key ("id"),
    constraint "meta_props_name" unique ("name")
);

create table meta_assign (
    "category" bigint not null,
    "meta" int not null,
    constraint "meta_assign_category"
        foreign key("category") 
        references categories(id) on update cascade on delete cascade,
    constraint "meta_assign_meta"
        foreign key("meta") 
        references meta_props(id) on update cascade on delete cascade
);

create table ads (
    id serial primary key,
    title varchar(255) not null,
    description text not null,
    category integer not null references categories(id),
    owner integer not null references users(id),
    city integer not null references cities(id),
    coordinates point,
    url text,
    messages boolean default true,
    show_phone boolean default false,
    phone text,
    price integer not null,
    currency currency not null,
    pictures text[] not null,
    created_at timestamp not null default current_timestamp,
    status varchar(20) not null default 'pending',
    check (status in ('pending', 'published', 'completed', 'dropped'))
);

create table favourites (
    "id" bigserial not null primary key,
    "user_id" bigint not null,
    "ad_id" bigint not null,
    "created_at" timestamp default current_timestamp not null,
    constraint "favourites_user_id"
        foreign key("user_id") 
        references users(id) on update cascade on delete cascade,
    constraint "favourites_ad_id"
        foreign key("ad_id") 
        references ads(id) on update cascade on delete cascade,
    constraint "favourites_unique" unique ("user_id","ad_id")
);

create table seo (
    "id" serial not null primary key,
    "uri" varchar(128) not null,
    "title" varchar(64) not null,
    "description" varchar(255) not null,
    "keywords" varchar(128) not null,
    "image" varchar(128) not null,
    "updated_at" timestamp not null,
    unique("uri")
);

create table reports (
    id serial primary key,
    reporter integer references users(id),
    reporter_name varchar(255),
    reporter_email varchar(255),
    reference varchar(2000) not null,
    reason varchar(255) not null,
    comments text not null,
    navitator varchar(255) not null,
    ip varchar(255) not null,
    created_at timestamp not null default current_timestamp,
    status varchar(20) not null default 'pending',
    foreign key (reporter) references users(id),
    check (status in ('pending', 'approved', 'rejected')),
    check (reason in ('inappropriate', 'spam', 'other')),
    unique (reporter_email,reference,reason,comments,navitator,ip)
);

CREATE INDEX reports_index ON reports(reporter,reason,status);

